import React from 'react'
import {Link} from'react-router-dom';

function Navigator() {
    return (
        <div className='Navigator'>
            <nav>
                <h2>Home Bank</h2>
                <ul className='nvlink'>
                    <Link to="/"><li>Home</li></Link>
                    <Link to="/batchProcessing"><li>Batch Processing</li></Link>
                </ul>
            </nav>
        </div>
    )
}

export default Navigator
